import React from "react";

function CardInfo(props) {
    return (
        <div className="col-md-4 col-sm-6 border">
            <div className="card bg-dark text-white" id="div1">
                <div className="card-header">
                </div>

                <div className="card-body" style={{ backgroundColor: props.info.email ? 'black' : 'white' }}>
                    <h1> Name : {props.info}</h1>
                </div>


            </div>
        </div>

    );
}
export default CardInfo
